import JSZip from 'jszip';
import { saveAs } from 'file-saver';
import './index.css';

const Download = () => {
  var zip = new JSZip();
  var zipFilename = 'nfts.zip';

  var url= `data:image/png;base64,`

  function donwloadAll () {
    fetch(url).then(base64Response => {
      base64Response.blob().then(blob => {
        for(let index=0; index<1000; index++){
          var filename = 'file-' + index + '.png'
          zip.file(filename, blob, { binary: true });
        }
        zip.generateAsync({ type: 'blob' }).then(zipFile => {
          saveAs(zipFile, zipFilename);
        })
      })
    })
  }

  return (
    <button onClick={donwloadAll} className='downloadButton'>
      Download Zip
    </button>
  );
};

export default function App() {
  return (
    <div className='mainDivContainer'>
      <div className='mainDiv'>
        {/* <Folder color='#f5b507' size={50} /> */}
        <h5 style={{ margin: '20px' }}>
          Download 10,000 client-side generated png's demo
        </h5>
      </div>
      <div className='App'>
        <Download />
      </div>
    </div>
  );
}
